  render() {
      if (this.props.adImg === 'header') {
        return (
            <section className="sect red cf">
                <LeftInformations />
                <SmallImagesect margin="left"/>
            </section>
        )
      } else {
        return (
          <section className="sect red cf">
              <SmallImagesect margin="right"/>
              <LeftInformations />
          </section>
      )
      }
    }
}


  // small image + article
